import React from 'react';

class Header extends React.Component {

    render () {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">Test 33</div>
                    <div className="col" style={{color: "red"}}>Test 67</div>
                </div>
            </div>
        );
    }
}

export default Header;
